const newPdfGenerate = async (data, id) => {
  let newData = data;
  let batch = data.items;
  // console.log("before" , batch);
  for (let i = 0; i < batch.length; i++) {
    batch[i].price = parseFloat((parseFloat(batch[i].price) * (100 / 118)).toFixed(2));
  }
  // console.log("after" , batch);
  newData.items = batch;
  const pdfDoc = generateInvoicePdf(newData);
  const randomNumber = Math.random();
  let filePath = path.join(`SDC_Online_23_24_${randomNumber}.pdf`)
  // pdfDoc.pipe(fs.createWriteStream(filePath));
  // pdfDoc.end();
  // return filePath;
  return new Promise((resolve, reject) => {
    const writeStream = fs.createWriteStream(filePath);

    pdfDoc.pipe(writeStream);
    pdfDoc.end();

    // Wait for the file to finish writing
    writeStream.on('finish', () => {
      resolve(filePath); // Resolve the promise when writing is complete
    });

    writeStream.on('error', (err) => {
      reject(err); // Reject the promise if an error occurs
    });
  });

}

module.exports = {
  newPdfGenerate
}

